import React from 'react';
import TodoItem from './TodoItem';

function TodoList(props) {
  if (props.data.isLoading === true) {
    return (
      <h1>TodoApp is loading...</h1>
    )
  }

  return (
    <div>
      {props.data.todos.map(data => {
        return <TodoItem key={data.id} item={data} handleChange={props.data.handleChange} />
      })}
    </div>
  )
}

export default TodoList;
